import React from 'react';
import '../styles/components.css';

const Contact: React.FC = () => {
    return (
        <section className="contact" id="contact">
            <h2>./Contacto</h2>
            <p>Si deseas ponerte en contacto, por favor completa el siguiente formulario o envíame un correo electrónico.</p>
            <form>
                <div className="form-group">
                    <label htmlFor="name">Nombre:</label>
                    <input type="text" id="name" name="name" required />
                </div>
                <div className="form-group">
                    <label htmlFor="email">Correo Electrónico:</label>
                    <input type="email" id="email" name="email" required />
                </div>
                <div className="form-group">
                    <label htmlFor="message">Mensaje:</label>
                    <textarea id="message" name="message" required></textarea>
                </div>
                <button type="submit">Enviar</button>
            </form>

            <br/>
            <p>O envíame un correo directamente a: <a href="mailto:tu-email@example.com">tu-email@example.com</a></p>
        </section>
    );
};

export default Contact;
